# Check commutativity
def check_commute(s1, s2):
    """Count anticommuting positions (X-Z or Z-X overlaps)"""
    count = 0
    for c1, c2 in zip(s1, s2):
        if (c1 == 'X' and c2 == 'Z') or (c1 == 'Z' and c2 == 'X'):
            count += 1
        elif (c1 == 'Y' and c2 in 'XZ') or (c2 == 'Y' and c1 in 'XZ'):
            count += 1
    return count % 2 == 0  # True if they commute

# Check all pairs
anticommute_pairs = []
for i in range(len(stabilizers)):
    for j in range(i+1, len(stabilizers)):
        if not check_commute(stabilizers[i], stabilizers[j]):
            anticommute_pairs.append((i, j))

print(f"Anticommuting pairs: {len(anticommute_pairs)}")
if anticommute_pairs:
    print(f"First few: {anticommute_pairs[:5]}")

# Try using stim
try:
    # Convert to PauliString objects
    stab_paulis = [stim.PauliString(s) for s in stabilizers]
    tableau = stim.Tableau.from_stabilizers(stab_paulis, allow_redundant=True, allow_underconstrained=True)
    circuit = tableau.to_circuit()
    print(f"Circuit generated with {len(circuit)} operations")
    print(circuit)
except Exception as e:
    import traceback
    traceback.print_exc()
    print(f"Error: {e}")
